"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Sarcoidosis (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/sarcoidosis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H481783473\">",
"      <span class=\"h1\">",
"       What is sarcoidosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sarcoidosis is a disorder that causes clusters of abnormal tissue to form in the body. These clusters are called &ldquo;granulomas.&rdquo; If many granulomas form in an organ, they can keep the organ from working normally. For example, granulomas can form in the lungs and cause breathing problems.",
"     </p>",
"     <p>",
"      Sarcoidosis can affect many different organs. Often it affects the lungs, but it can also affect the skin, eyes, nose, and lots of other body parts.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H481783480\">",
"      <span class=\"h1\">",
"       What are the symptoms of sarcoidosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sarcoidosis causes different symptoms depending on which body part it affects. Often the symptoms are mild and go away on their own.",
"     </p>",
"     <p>",
"      When it affects the lungs, sarcoidosis can cause:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Cough",
"       </li>",
"       <li>",
"        Trouble breathing",
"       </li>",
"       <li>",
"        Chest pain",
"       </li>",
"       <li>",
"        Tiredness or weakness",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Weight loss",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      When it affects the skin, sarcoidosis can cause a mild rash or painful bumps. Sometimes the rash and bumps go away completely. Other times, they leave a scar.",
"     </p>",
"     <p>",
"      Sometimes, sarcoidosis causes no symptoms even though it is damaging certain organs. For this reason, people with sarcoidosis may need to have tests to check for organ damage.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H481783487\">",
"      <span class=\"h1\">",
"       How do I know if I have sarcoidosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There is no single &ldquo;test&rdquo; that can tell if you have sarcoidosis. To diagnose it, doctors and nurses look at:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Your symptoms and your physical exam",
"       </li>",
"       <li>",
"        X-rays (or special X-rays called CT scans)",
"       </li>",
"       <li>",
"        Lab work on tissue taken from your body (called a biopsy)",
"       </li>",
"       <li>",
"        Tests that can rule out other causes of your condition",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H481783494\">",
"      <span class=\"h1\">",
"       How is sarcoidosis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors and nurses do not know what causes sarcoidosis, so they do not have a treatment to cure it. Luckily, they do have ways to treat its symptoms. Even so, if your symptoms are mild, you may not need treatment.",
"     </p>",
"     <p>",
"      Medicines called steroids can relieve the symptoms of sarcoidosis and prevent some of the damage it can cause. People with severe symptoms can take medicines called steroids. These steroid medicines are not the kind that athletes take to build up muscle. These steroids reduce swelling and shrink the granulomas caused by sarcoidosis. Sometimes, people can use skin creams, eye drops, and inhalers that have steroids in them.",
"     </p>",
"     <p>",
"      Even though steroid pills can help with the problems caused by sarcoidosis, they can also cause problems of their own. For instance, steroids can cause weight gain and mood swings, and make diabetes worse. For this reason, doctors and nurses try to take people off steroids as soon as possible.",
"     </p>",
"     <p>",
"      Medicines besides steroids can also help with sarcoidosis. Doctors and nurses usually use these medicines only in people who cannot take steroids or who do not get better with steroids.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H481783501\">",
"      <span class=\"h1\">",
"       How will sarcoidosis affect my life?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sarcoidosis usually goes away on its own or does not get worse. Sometimes it does get worse and can spread to many organs. Even so, people do not usually die from sarcoidosis.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H481783508\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?5/35/5683?source=see_link\">",
"       Patient information: Sarcoidosis (Beyond the Basics)",
"      </a>",
"     </p>",
