"      </span>",
"     </li>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Mineral, Oral",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block dos drugH1Div\" id=\"F1013930\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Usual",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_general\" href=\"UTD.htm?7/39/7798?source=see_link\">",
"      see \"Ferrous fumarate: Drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Oral (dose expressed in terms of",
"     <b>",
"      elemental",
"     </b>",
"     iron):",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Recommended Daily Allowance: See table.",
"    </p>",
"    <table border=\"1\" frame=\"border\" rules=\"all\">",
"     <caption style=\"text-align:center;\">",
"      Recommended Daily Allowance of Iron:",
"      <b>",
"       (Dosage expressed as elemental iron)",
"      </b>",
"     </caption>",
"     <col align=\"left\" width=\"175\">",
"     </col>",
"     <col align=\"center\" width=\"175\">",
"     </col>",
"     <thead valign=\"middle\">",
"      <tr>",
"       <th align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         Age",
"        </p>",
"       </th>",
"       <th align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         RDA",
"        </p>",
"        <p style=\"text-indent:0em;\">",
"         (mg)",
"        </p>",
"       </th>",
"      </tr>",
"     </thead>",
