"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:0em;\">",
"         1 to &lt;5 mo",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         5",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:0em;\">",
"         5 mo to 10 y",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         10",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:0em;\">",
"         Male",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:2em;\">",
"         11-18 y",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         12",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:2em;\">",
"         &gt;18 y",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         10",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:0em;\">",
"         Female",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:2em;\">",
"         11-50 y",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         15",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:2em;\">",
"         &gt;50 y",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         10",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"    <p style=\"text-indent:-2em;margin-left:2em;margin-top:2em;\">",
"     <b>",
"      Treatment and prevention of iron deficiency:",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Children:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Severe iron deficiency anemia: 4-6 mg elemental iron/kg/day in 3 divided doses",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Mild to moderate iron deficiency anemia: 3 mg elemental iron/kg/day in 1-2 divided doses",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Prophylaxis: 1-2 mg elemental iron/kg/day up to a maximum of 15 mg elemental iron/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Adults:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Iron deficiency: 2-3 mg/kg/day or 60-100 mg elemental iron twice daily up to 60 mg elemental iron 4 times/day, or 50 mg elemental iron (extended release) 1-2 times/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Prophylaxis: 60-100 mg elemental iron/day",
"    </p>",
