var title_f20_14_20715="Lichenoid drug eruption histology differential";
var content_f20_14_20715=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F83936&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F83936&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Histologic features in lichenoid drug eruption and lichen planus",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Differential criteria",
"       </td>",
"       <td class=\"subtitle1\">",
"        Lichen planus",
"       </td>",
"       <td class=\"subtitle1\">",
"        Lichenoid drug eruption",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Cornified layer",
"       </td>",
"       <td>",
"        Compact hyperorthokeratosis, seldom a moderate degree of parakeratosis",
"       </td>",
"       <td>",
"        Focal parakeratosis; cytoid bodies in the cornified layer",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Epidermis",
"       </td>",
"       <td>",
"        Thickened stratum granulosum at acrosyringia and acrotrichia, irregular saw-tooth-like acanthosis, necrotic keratinocytes in the lower epidermal layers",
"       </td>",
"       <td>",
"        Thickened stratum granulosum possible, however, with focal interruption of the granular layer, cytoid bodies in the granular layer, necrotic keratinocytes scattered in all epidermal layers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dermis",
"       </td>",
"       <td>",
"        Mostly a superficial dermal inflammatory infiltrate; seldom eosinophils",
"       </td>",
"       <td>",
"        More often a deep dermal inflammatory infiltrate (especially in non-photodistributed lichenoid drug eruption); admixture of eosinophils and plasma cells possible*",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Presence of plasma cell is a regular finding in biopsies from mucous membranes independently of the origin of dermatosis.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
