var content_f20_14_20716=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F76772&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F76772&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical findings in air embolism",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Symptoms",
"       </td>",
"       <td class=\"subtitle1\">",
"        Physical findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Pulmonary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Dyspnea (100 percent incidence)",
"        </p>",
"        <p>",
"         \"Gasp reflex\"*",
"        </p>",
"        <p>",
"         \"Sucking sound\"&bull;",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Tachypnea",
"        </p>",
"        <p>",
"         Wheeze",
"        </p>",
"        <p>",
"         Rales",
"        </p>",
"        <p>",
"         Respiratory failure",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Cardiac",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Substernal chest pain",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Hypotension",
"        </p>",
"        <p>",
"         Tachycardia",
"        </p>",
"        <p>",
"         Mill wheel murmur&Delta;",
"        </p>",
"        <p>",
"         Signs of right heart failure (eg, elevated JVD)",
"        </p>",
"        <p>",
"         Shock",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Neurologic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Sense of doom",
"        </p>",
"        <p>",
"         Dizziness/lightheadedness",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Change in mental status",
"        </p>",
"        <p>",
"         Focal neurological deficits",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Skin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        <p>",
"         Crepitus over superficial vessels (seen rarely in setting of massive air embolus)",
"        </p>",
"        <p>",
"         Livedo reticularis",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Ocular",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Bubbles within the retinal arteries",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * A gasp or cough is at times reported when a bolus of air enters the pulmonary circulation.",
"     <br>",
"      &bull; A sucking noise can be heard on occasion when air is sucked into the intravascular space, such as when air embolism occurs as a complication of a central line.",
"      <br>",
"       &Delta; The mill wheel murmur is a relatively specific sign classically associated with venous air embolism but only rarely heard. It is a churning sound heard throughout the entire cardiac cycle and is caused by the movement of air bubbles in the right ventricle.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
