"    Compensatory response to chronic respiratory alkalosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 228px; height: 244px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Combined significance bands for plasma pH and concentrations of H+ and HCO3- in chronic respiratory alkalosis in humans. In uncomplicated chronic respiratory alkalosis, values for the H+ and HCO3- concentrations will, with an estimated 95 percent probability, fall within the band. Values lying outside the band indicate the presence of a complicating metabolic acid-base disturbance. Note that the compensatory reduction in the plasma HCO3- concentration is so effective that there is little fall in pH.",
